  return (
    <div className='one1'>
      <div>
        {/* <div> */}
        <h1>ABOUT US</h1>
        <h5>Restaurant</h5>
        <p>The dailies? You know milk, bread, eggs -- the dailies.These are the things you eat that you find yourself running out each week (or each day) to purchase.</p>
        <button><p>Read More</p></button>
        {/* </div> */}
        <div>
          <img src={img}/>
        </div>
        {/* <div style={{backgroundImage:'url("https://dynamic-media-cdn.tripadvisor.com/media/photo-o/06/fe/db/b1/ministry-of-food.jpg?w=1200&h=-1&s=1")', height:750, backgroundSize:'cover'}}>

        </div> */}
      </div>
    </div>
  )
}
